window.screens = window.screens || {};
var path = window.core.getPath('subscribe.js');

window.controls['planlist'] = {
    'js':[],
    'css':[],
    'on_init':function(){
        let self = this;
        $(this).addClass('spinner');
        firebase.auth().currentUser.getIdToken().then(function(token){
            return window.vxgstripe.getUserInfo(token).then(function(r){
                if (!r.plans || r.plans.length==0){
                    $(self).html('No available plans').removeClass('spinner');
                    return;
                }
                let html='<table><tr><th>#</th><th>Plan name</th><th>Plan period</th><th>Paid quantity</th><th>Expired</th><th style="display:none">Add</th></tr>';
                let c=1;
                for (let i=0;i<r.plans.length;i++){
                    if (!r.plans[i].active && r.plans[i].paid_quantity<1) continue;
                    let addbutton = r.plans[i].active ? '<button class="vxgbutton" onclick_toscreen="subscribe2" planid="'+r.plans[i].stripe_plan_id+'">Add</button>' : '(archive)';
                    html += '<tr><td>'+(c++)+'</td><td>'+(r.plans[i].metadata['name'] ? r.plans[i].metadata['name'] : r.plans[i].stripe_plan_description)+'</td><td>'+r.plans[i].stripe_plan_period+'</td><td>'+r.plans[i].paid_quantity+'</td><td>';
                    if (r.plans[i].expired)
                        html += vxg.support.dateToUserTimeString(new Date(r.plans[i].expired*1000));
                    html += '</td><td style="display:none">'+addbutton+'</td></tr>';
                }
                html += '</table>';
                $(self).html(html).removeClass('spinner');
            },function(){
                $(self).removeClass('spinner');
                alert('Fail to get user info');
            });
        });
    },
}

window.screens['subscribe'] = {
    'get_args':function(){
    },
    'header_name': 'Subscribe',
    'html': path+'subscribe.html',
    'js': [path+'vxgstripe.js'],
    'stablecss':[path+'subscribe.css'],
    'on_show':function(){
        return defaultPromise();
    },
    'on_hide':function(){
        return defaultPromise();
    },
    'on_ready':function(){
        core.elements['bottom-global-menu'].prepend('<span class="main-button active upgrade" style="width: calc(100% - 12px);height: 30px;" onclick_toscreen="subscribe">Upgrade</span>');

        return defaultPromise();
    },
    'on_signout':function(){
    },
    'on_init':function(){
        let self = this;
        $(self.wrapper).find('.planlist').addClass('spinner');
        return firebase.auth().currentUser.getIdToken().then(function(token){
            return window.vxgstripe.getUserInfo(token).then(function(r){

                r.plans = r.plans.sort(function(a, b){return a.stripe_plan_cost - b.stripe_plan_cost ;});

                let html='';
                for (let i in r.plans){
                    if (!r.plans[i].active) continue;
                    let desc='';
                    if (r.plans[i].metadata['desc1']) desc += '<li>'+r.plans[i].metadata['desc1']+'</li>';
                    if (r.plans[i].metadata['desc2']) desc += '<li>'+r.plans[i].metadata['desc2']+'</li>';
                    if (r.plans[i].metadata['desc3']) desc += '<li>'+r.plans[i].metadata['desc3']+'</li>';

                    // 1 month convert to month
                    //
                    let period  = r.plans[i].stripe_plan_period;
                    if (r.plans[i].stripe_plan_period == "1 month")
                        period = "month";

                    if (desc) desc = '<ul type="desc">'+desc+'</ul>';
                    html += '<div class="item" onclick_toscreen="subscribe2" planid="'+r.plans[i].stripe_plan_id+'"><div class="icon"><img src="img/vxg1.png"></div><div class="title">'+(r.plans[i].metadata['name'] ? r.plans[i].metadata['name'] : r.plans[i].stripe_plan_description)+'<br>&nbsp;</div>'
		        + '<div class="cost"><b>$'+((r.plans[i].stripe_plan_cost)/100).toFixed(2)+'</b>/'+period+'<br>per camera</div>'
		        + '<div class="desc">'+desc+'</div>'
		        + '</div>';
                }
                $(self.wrapper).find('.planlist').html(html);
                $(self.wrapper).find('.planlist').removeClass('spinner');
            }, function(){
                alert('Error on get user plans list');
                $(self.wrapper).find('.planlist').removeClass('spinner');
            });
        }, function(){
            alert('Error on get user token');
            $(self.wrapper).find('.planlist').removeClass('spinner');
        });
        return defaultPromise();
    }
};

window.screens['subscribe2'] = {
    'header_name': 'Subscribe step 2',
    'html': path+'subscribe2.html',
    'on_show':function(){
        $(this.wrapper).html(this.planid);

        $(this.wrapper).find('[name="postalzip"]').val(window.vxgstripe.user_info.postalzip);

        populateCountries($(this.wrapper).find('[name="country"]')[0], $(this.wrapper).find('[name="state"]')[0], window.vxgstripe.user_info.country,window.vxgstripe.user_info.state);

        return defaultPromise();
    },
    'on_before_show':function(){
        if (!this.src) return defaultPromise();
        let planid = $(this.src).attr('planid');
        let self = this;
        core.elements['global-loader'].show();
        return firebase.auth().currentUser.getIdToken().then(function(token){
            return window.vxgstripe.getUserInfo(token).then(function(r){
                for (let i in r.plans){
                    if (r.plans[i].stripe_plan_id == planid){
                        self.plan = r.plans[i];
                        break;
                    }
                }
                core.elements['global-loader'].hide();
            }, function(){
                alert('Fail to get user info');
                core.elements['global-loader'].hide();
            });
        });
        return defaultPromise();
    },
    'on_hide':function(){
        return defaultPromise();
    },
    'on_ready':function(){
        return defaultPromise();
    },
    'on_init':function(){
        let self = this;
        $(this.wrapper).find('.next').click(function(){
            let count = parseInt($(window.screens['subscribe2'].wrapper).find('[name="count"]').val());
            if (isNaN(count) || count<1){
                core.flashInputBackgroundColor($(window.screens['subscribe2'].wrapper).find('[name="count"]'));
                return;
            }
            let country = $(window.screens['subscribe2'].wrapper).find('[name="country"]').val();
            if (country=="-1"){
                core.flashInputBackgroundColor($(window.screens['subscribe2'].wrapper).find('[name="country"]'));
                return;
            }
            let state = $(window.screens['subscribe2'].wrapper).find('[name="state"]').val();
            if (state=="-1"){
                core.flashInputBackgroundColor($(window.screens['subscribe2'].wrapper).find('[name="state"]'));
                return;
            }
            let postalzip = $(window.screens['subscribe2'].wrapper).find('[name="postalzip"]').val();
            if (!postalzip){
                core.flashInputBackgroundColor($(window.screens['subscribe2'].wrapper).find('[name="postalzip"]'));
                return;
            }

            window.core.onclick_toscreen('subscribe3');
        });

        return defaultPromise();
    }
};

window.screens['subscribe3'] = {
    'header_name': 'Subscribe step 3',
    'html': path+'subscribe3.html',
    'js': ['https://js.stripe.com/v3/'],
    update_tax: function(){
        let country = $(window.screens['subscribe2'].wrapper).find('[name="country"]').val();
        let state = $(window.screens['subscribe2'].wrapper).find('[name="state"]').val();
        let postalzip = $(window.screens['subscribe2'].wrapper).find('[name="postalzip"]').val();
        if (country==vxgstripe.user_info.country && state==vxgstripe.user_info.state && postalzip==vxgstripe.user_info.postalzip)
            return defaultPromise();
        return firebase.auth().currentUser.getIdToken().then(function(token){
            return vxgstripe.setTaxInfo(token, country, state, postalzip);
        });

    },
    'on_show':function(){
        let self = this;
        let count = parseInt($(window.screens['subscribe2'].wrapper).find('[name="count"]').val());
        let amount = count * window.screens['subscribe2'].plan.stripe_plan_cost;
        $(this.wrapper).find('.invite').empty().html(''
            + '<div><div>Plan name:</div>&nbsp;'+(window.screens['subscribe2'].plan.metadata['name'] ? window.screens['subscribe2'].plan.metadata['name'] : window.screens['subscribe2'].plan.stripe_plan_description)+'</div>'
            + '<div><div>Amount:</div>&nbsp;'+count+'</div>'
            + '<div><div>Cost:</div>&nbsp;$'+(amount/100).toFixed(2)+'<div>');

        core.elements['global-loader'].show();
        return this.update_tax().then(function(){
            return firebase.auth().currentUser.getIdToken().then(function(token){
                let _token = token;
                return vxgstripe.getTaxRate(token, amount).then(function(r){

                    $(self.wrapper).find('.invite').append('<div><div>Tax rate:</div>&nbsp;'+r+'</div>');

                    return vxgstripe.getPk(_token).then(function(r){
                        if (!self.stripe) self.stripe = Stripe(r);
	                var elements = self.stripe.elements();
                        var style = {
                          base: {
                            color: '#32325d',
                            fontFamily: '"Helvetica Neue", Helvetica, sans-serif',
                            fontSmoothing: 'antialiased',
                            fontSize: '16px',
                            '::placeholder': {
                              color: '#aab7c4'
                            }
                          },
                          invalid: {
                            color: '#fa755a',
                            iconColor: '#fa755a'
                          }
                        };

                        self.card = elements.create('card', {style: style, hidePostalCode: true});
                        self.card.mount('#card-element');
                        self.card.off('change').on('change', function(event) {
                          this.card_empty = event.empty;
                          var displayError = document.getElementById('card-errors');
                          if (event.error) {
                            displayError.textContent = event.error.message;
                          } else {
                            displayError.textContent = '';
                          }
                        });
                        core.elements['global-loader'].hide();

                    }, function(){
                        alert('Fail to get stripe pk');
                        core.elements['global-loader'].hide();
                    });

                }, function(){
                    alert('Fail to get tax rate');
                    core.elements['global-loader'].hide();
                });
            });
        }, function(){
            alert('Fail to update tax info');
            core.elements['global-loader'].hide();
        });
    },
    'on_before_show':function(){
        return defaultPromise();
    },
    'on_hide':function(){
        return defaultPromise();
    },
    'on_ready':function(){
        return defaultPromise();
    },
    'on_init':function(){
        let self = this;
        this.card_empty = true;
        $(this.wrapper).find('.next').click(function(){
            let cardtoken='';
            core.elements['global-loader'].show();
            var additionalData = {
                address_state: $(window.screens['subscribe2'].wrapper).find('[name="state"]').val(),
                address_zip: $(window.screens['subscribe2'].wrapper).find('[name="postalzip"]').val(),
                address_country: $(window.screens['subscribe2'].wrapper).find('[name="country"]').val()
            };
            self.stripe.createToken(self.card, additionalData).then(function(result) {
                if (self.card_empty && vxgstripe.user_info.stripe_card_token && vxgstripe.user_info.stripe_card_token == result.token.id) {
                    return firebase.auth().currentUser.getIdToken().then(function(token){
                        return self.set_plan(token);
                    });
                }
                if (result.error) {
                  // Inform the user if there was an error.
                    var errorElement = document.getElementById('card-errors');
                    errorElement.textContent = result.error.message;
                    core.elements['global-loader'].hide();
                } else {
                    cardtoken = result.token.id;
                    return firebase.auth().currentUser.getIdToken().then(function(token){
                        let _token = token;
                        return vxgstripe.setCard(token, cardtoken).then(function(){
                            return self.set_plan(_token);
                        },function(){
                            alert('Fail to set stripe card token');
                            core.elements['global-loader'].hide();
                        });
                    });
                }
            }, function(){
                alert('Fail to create stripe card token');
                core.elements['global-loader'].hide();
            });

        });

        return defaultPromise();
    },
    set_plan: function(user_token){
        let planid = screens['subscribe2'].plan.stripe_plan_id;
        let quantity = parseInt(screens['subscribe2'].plan.paid_quantity) + parseInt($(window.screens['subscribe2'].wrapper).find('[name="count"]').val());
        return vxgstripe.setPlan(user_token, planid, quantity).then(function(){
            core.elements['global-loader'].hide();
            window.core.onclick_toscreen('subscribe4');
        }, function(r){
            alert('Fail to pay plan: '+(typeof r.responseText === "string" ? r.responseText : ''));
            core.elements['global-loader'].hide();
        });
    }
};

