function populateStates(countryElement, stateElement, selectedState) {
 
    var selectedCountryIndex = countryElement.selectedIndex;
 

    stateElement.length = 0; 
    stateElement.options[0] = new Option('Select State', '');
 
    var state_arr = s_a[selectedCountryIndex];
    let selectedStateIndex=0;
 
    for (var i = 0; i < state_arr.length; i++) {
        stateElement.options[stateElement.length] = new Option(state_arr[i][0]+' '+state_arr[i][1], state_arr[i][0]);
        if (selectedState == state_arr[i][0])
            selectedStateIndex = i+1;
    }
    stateElement.selectedIndex = selectedStateIndex;

}
 
function populateCountries(countryElement, stateElement, selectedCountry, selectedState) {
    // given the id of the <select> tag as function argument, it inserts <option> tags
//    var countryElement = document.getElementById(countryElementId);
    countryElement.length = 0;
    countryElement.options[0] = new Option('Select Country', '-1', false, false);
    
    let selectedCountryIndex=0;
    for (var i = 0; i < country_arr.length; i++) {
        countryElement.options[countryElement.length] = new Option(country_arr[i][0]+' '+country_arr[i][1], country_arr[i][0]);
        if (selectedCountry == country_arr[i][0])
            selectedCountryIndex = i+1;
    }
    countryElement.selectedIndex = selectedCountryIndex;
 
    // Assigned all countries. Now assign event listener for the states.
 
    if (stateElement) {
	populateStates(countryElement, stateElement, selectedState);
        countryElement.onchange = function () {
            populateStates(countryElement, stateElement, selectedState);
        };
    }
}
